sys_variable_value.value:
(function execute(inputs, outputs) {
  var val = new sn_docintel.DocIntelAPI().getExtractedValues(inputs.task_id);
  var extracted_values = "";

  for (i=0; i < val.length; i++){
    extracted_values = extracted_values + val[i].key_display_name + ": " + val[i].data + "\n";
  }
  outputs.extracted_values = extracted_values;
})(inputs, outputs);

